// https://github.com/iamkun/dayjs/blob/v1.9.7/src/locale/zh-cn.js

dayjs.locale(
  {
    name: "zh-cn",
    weekdays: "______".split("_"),
    weekdaysShort: "______".split("_"),
    weekdaysMin: "______".split("_"),
    months: "___________".split("_"),
    monthsShort: "1_2_3_4_5_6_7_8_9_10_11_12".split("_"),
    ordinal: (number, period) => {
      switch (period) {
        case 'W':
          return `${number}`
        default:
          return `${number}`
      }
    },
    weekStart: 1,
    yearStart: 4,
    formats: {
      LT: "HH:mm",
      LTS: "HH:mm:ss",
      L: "YYYY/MM/DD",
      LL: "YYYYMD",
      LLL: "YYYYMD HHmm",
      LLLL: "YYYYMDdddd HHmm",
      l: "YYYY/M/D",
      ll: "YYYYMD",
      lll: "YYYYMD HH:mm",
      llll: "YYYYMDdddd HH:mm",
    },
    relativeTime: {
      future: "%s",
      past: "%s",
      s: "",
      m: "1 ",
      mm: "%d ",
      h: "1 ",
      hh: "%d ",
      d: "1 ",
      dd: "%d ",
      M: "1 ",
      MM: "%d ",
      y: "1 ",
      yy: "%d ",
    },
    meridiem: (hour, minute) => {
      const hm = (hour * 100) + minute
      if (hm < 600) {
        return ''
      } else if (hm < 900) {
        return ''
      } else if (hm < 1130) {
        return ''
      } else if (hm < 1230) {
        return ''
      } else if (hm < 1800) {
        return ''
      }
      return ''
    }
  }, null, false);


